                </div>
            </Container>
        </Jumbotron>

        <Jumbotron fluid className="portfolio">
            <style>{`.portfolio{
                background-color: #f8f9fa;
                padding-top: 80px;
                padding-bottom: 80px;
                margin-bottom: 0rem !important;
                position: relative;
            }.portfolio-link{
                position: absolute;
                top: 0px;
            }`}</style>
            <Container className="text-center">
                <a name="portfolio" className="portfolio-link"/>
                <div>
                    <h2 className="display-4">Portfólio</h2>
                    <p className="lead pb-4">featured content or information.</p>
                </div>

                <div className="row row-cols-1 row-cols-md-2 row-cols-md-3">
                    <div className="col mb-4">
                        <div className="card">
                            <img src="/1.jpg" className="card-img-top" alt="Foto_Perfil"/>
                            <div className="card-body">
                                <h5 className="card-title">Card title</h5>
                                <p className="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
