                            </div>
                        </div>
                    </div>
                    <div className="col mb-4">
                        <div className="card">
                            <img src="/1.jpg" className="card-img-top" alt="..."/>
                            <div className="card-body">
                                <h5 className="card-title">Card title</h5>
                                <p className="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                            </div>
                        </div>
                    </div>
                    <div className="col mb-4">
                        <div className="card">
                            <img src="/2.jpg" className="card-img-top" alt="..."/>
                            <div className="card-body">
                                <h5 className="card-title">Card title</h5>
                                <p className="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                            </div>
                        </div>
                    </div>
                    <div className="col mb-4">
                        <div className="card">
                            <img src="/3.jpg" className="card-img-top" alt="Músico"/>
                            <div className="card-body">
                                <h5 className="card-title">Card title</h5>
                                <p className="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                            </div>
                        </div>
                    </div>
                </div>
            </Container>
        </Jumbotron>

        <Jumbotron fluid className="exemplo">
            <style>{`.exemplo{
                position: relative;
            }.exemplo-link{
                position: absolute;
                top: 0px;
            }`}</style>
            <Container className="container text-center">
                <a name="exemplo" className="exemplo-link"/>
                <div className="texto">
                    <h2 className="display-4">Exemplo</h2>
                    <hr />
                </div>
                <div className="row featurette">
                    <div className="col-md-7 personalizar">
                        <style>{`.personalizar{
                            margin-top:15%;
                        }`}</style>
                        <h2 className="featurette-heading">First featurette heading. <span className="text-muted">It’ll blow your mind.</span></h2>
                        <p className="lead">Donec ullamcorper nulla non metus auctor fringilla. Vestibulum id ligula porta felis euismod semper. Praesent commodo cursus magna, vel scelerisque nisl consectetur. Fusce dapibus, tellus ac cursus commodo.</p>
                    </div>
                    <div className="col-md-5">
                        <img src="/4.jpg" className="card-img-top" alt="Músico"/>
                    </div>
                </div>
            </Container>
        </Jumbotron>

        <Jumbotron fluid className="rodape">
            <style>{`.rodape{
                background-color: #000;
                color: #fff;
                padding-top: 0px;
                padding-bottom: 0px;
                margin-bottom: 0rem !important;
            }`}</style>			
            <Container className="text-center">
                <footer className="footer mt-auto py-3">
                    <div className="container">
                        <span className="text-muted">Paulo Teixeira</span>
                    </div>
                </footer>				
            </Container>					
        </Jumbotron>
    </div>   
);

Home.getInitialProps = async () => {
    var response = await axios.get('http://localhost:8080/home');
    console.log(response);
    return {response: response.data};
}

export default Home;
